(26,	'woocommerce-blocks-sqli-july-2021-need-to-update',	'update',	'en_US',	'Action required: Critical vulnerabilities in WooCommerce Blocks',	'In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.',	'{}',	'pending',	'woocommerce.com',	'2022-03-15 20:27:05',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(27,	'woocommerce-core-sqli-july-2021-store-patched',	'update',	'en_US',	'Solved: Critical vulnerabilities patched in WooCommerce',	'In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.',	'{}',	'pending',	'woocommerce.com',	'2022-03-15 20:27:07',	NULL,	0,	'plain',	'',	0,	0,	'info'),
