(35,	'wcpay_applepay_q1_2022',	'marketing',	'en_US',	'Increase conversions with Apple Pay – just like Diane does',	'See how Diane from <a href=\"https://woocommerce.com/posts/lady-dye-yarns-from-crafts-to-activism-with-woocommerce/?utm_source=product&amp;utm_medium=inboxnotification&amp;utm_campaign=apple-pay\" target=\"_blank\">Lady Dye Yarns</a> uses Apple Pay to provide customers with the fast, secure checkout experience they love. You can, too – Apple Pay is included in WooCommerce Payments. Here\'s how you can increase conversions by encouraging shoppers to pay with a single tap.',	'{}',	'pending',	'woocommerce.com',	'2022-03-15 20:27:12',	NULL,	0,	'plain',	'',	0,	0,	'info'),
