(37,	'stripe_applepay_q1_2022',	'marketing',	'en_US',	'Increase conversions with Apple Pay – just like Thomas does',	'Read the inspirational story of <a href=\"https://woocommerce.com/posts/incredible-story-of-thomas-trendy-socks-down-syndrome-entrepreneur/?utm_source=product&amp;utm_medium=inboxnotification&amp;utm_campaign=apple-pay\" target=\"_blank\">Thomas\'s Trendy Socks</a> and see how he’s using Apple Pay to provide customers with the fast, secure checkout experience they love. You can, too – ready to turn more visitors into buyers? Accept Apple Pay by selecting Enable express checkouts in Settings &gt; Payments &gt; Stripe.',	'{}',	'pending',	'woocommerce.com',	'2022-03-15 20:27:13',	NULL,	0,	'plain',	'',	0,	0,	'info'),
