(39,	'square_applepay_q1_2022',	'marketing',	'en_US',	'Increase conversions with a faster checkout experience',	'By enabling Apple Pay in Square, your customers can complete purchases quickly and securely with a single touch or a glance – no lengthy checkout forms necessary. Accept Apple Pay by enabling Digital Wallets within Settings &gt; Payments &gt; Square.',	'{}',	'pending',	'woocommerce.com',	'2022-03-15 20:27:15',	NULL,	0,	'plain',	'',	0,	0,	'info'),
